function find_focus() {

  var bFound = false;
  var F;

  // for each form
  //alert ("Form length = " + document.forms.length )
  for (f=0; f < document.forms.length; f++)
  {
    // for each element in each form
    for(i=0; i < document.forms[f].length; i++)
    {
      // if it's not a hidden element
      F = document.forms[f].elements[i];
      if (F.disabled) { continue }
      if (F.type != "text" & F.type != "textarea") { continue }
     
      // set the focus to it
      F.focus();
      bFound = true;
      // if found in this element, stop looking
      if (bFound == true)
        break;
    }
    // if found in this form, stop looking
    if (bFound == true)
      break;
  }
} 

function getRelativeCoords( e )
{
   var docX, docY;
   if( e )
   {
      if( typeof( e.pageX ) == 'number' )
      {
         docX = e.pageX;
         docY = e.pageY;
      }
      else
      {
         docX = e.clientX;
         docY = e.clientY;
      }
   }
   else
   {
      e = window.event;
      docX = e.clientX;
      docY = e.clientY;
      if( document.documentElement
        && ( document.documentElement.scrollTop
            || document.documentElement.scrollLeft ) )
      {
         docX += document.documentElement.scrollLeft;
         docY += document.documentElement.scrollTop;
      } 
      else if( document.body
         && ( document.body.scrollTop
             || document.body.scrollLeft ) )
      {
         docX += document.body.scrollLeft;
         docY += document.body.scrollTop;
      }
   }
   
   //now make it relative
   var el = e.target || e.srcElement;
   var elPos = {x:0, y:0};
   if (el.offsetParent) {
     elPos.x = el.offsetLeft;
     elPos.y = el.offsetTop;
     while (el = el.offsetParent) {
       elPos.x += el.offsetLeft;
       elPos.y += el.offsetTop;
     }
   }
   var relX = (docX - elPos.x);
   var relY = (docY - elPos.y);
   return {x:relX, y:relY};
}

function getPoint_frames(e) {
	relPoints = getRelativeCoords(e);
	
	var cell;
	var mindist = 9999;
	for (i in points_frames) {
		xdiff = Math.abs(points_frames[i].x - relPoints.x);
		ydiff = Math.abs(points_frames[i].y - relPoints.y);
		if ( (xdiff > 20) || (ydiff > 20) ) {
			continue;
		}
		dist = Math.sqrt((xdiff*xdiff) + (ydiff*ydiff));
		if (dist < mindist) {
			mindist = dist;
			cell = points_frames[i].cell;
		}
	}
	document.moveEntry.move.value = cell;
	document.moveEntry.move.focus();
	//alert('Cell: ' + cell);
	return cell;
}

